import '../App.css';
import React from 'react';
import { connect } from 'react-redux';
import TimeWidget from './widgets/TimeWidget';
import GreetingWidget from './widgets/GreetingWidget';
import QuoteWidget from './widgets/QuoteWidget';
import WeatherWidget from './widgets/WeatherWidget';
import LinkTileWidget from './widgets/LinkTileWidget';

class LinkTileSection extends React.Component {
    render() {
        return(
            <div>
                <h4 style={{textAlign: 'left', color: 'white', margin: '15px'}}>Link Tiles</h4>
                <LinkTileWidget />
            </div>
        )
    }
}

function mapStateToProps(state, ownProps) {
    return {
      widgetDetails: state.widgetDetails
    }
}

export default connect(mapStateToProps)(LinkTileSection);
